def clean(text):
    stop = set(STOPWORDS)
    stop.update(('fwd'))
    exclude = set(string.punctuation) 
    lemma = WordNetLemmatizer()
    text=text.rstrip()
    text = re.sub(r'[^a-zA-Z]', ' ', text)
    stop_free = " ".join([i for i in text.lower().split() if((i not in stop) and (not i.isdigit()) and len(i)>2)])
    punc_free = ''.join(ch for ch in stop_free if ch not in exclude)
    normalized = " ".join(lemma.lemmatize(word) for word in punc_free.split() if word in nouns)
    
    uniqueWords = []
    UniWords = ""
    
    words = normalized.split()

    for word in words:
        # Loop that define only unique terms
        if word not in uniqueWords:
            uniqueWords.append(word)
            UniWords = UniWords + " " + word
    
    return UniWords

def word_count(str):
    counts = dict()
    words = str.split()

    for word in words:
        if word in counts:
            counts[word] += 1
        elif(len(word)>2):
            counts[word] = 1

    return counts
    
def get_text_from_email(msg):
    # To get the content from email objects
    parts = []
    for part in msg.walk():
        if part.get_content_type() == 'text/plain':
            parts.append( part.get_payload() )
    return ''.join(parts)

